/**
 * Smoothly animate a range input accounting for hiccups and diverging playback.
 */
export class RangeAnimation {
    constructor(range: any, callback: any, fps: any);
    callback: any;
    fps: any;
    start(): void;
    stop(): void;
    update({ start, duration, playbackRate }: {
        start: any;
        duration: any;
        playbackRate: any;
    }): void;
    duration: any;
    playbackRate: any;
    #private;
}
